import React from "react";
import "./Spotify.scss";

const spotify = props => {
  return <div className="spotify">
    <div className="spotify__playlist">
      <div className="spotify__playlist__song"></div>
    </div>
    <div className="spotify__albumCover"></div>
    <div className="spotify__toolBar">
      <div className="spotify__toolBar__info"></div>
      <div className="spotify__toolBar__control"></div>
      <div className="spotify__toolBar__volume"></div>
    </div>
  </div>;
};

export default spotify;
